import React from "react";
import ReactDOM from "react-dom/client";
import { createBrowserRouter, RouterProvider, Route, Redirect } from "react-router-dom";
import App from "./App";
import Cadastrar from "./componentes/routes/Cadastrar";
import Visualizar from "./componentes/routes/Visualizar";
import Error from "./componentes/routes/Error";
import VisualizarDB from "./componentes/pages/VisualizarDB";
import Home from "./componentes/routes/Home";

const router = createBrowserRouter([
  {
    path: "/",
    element: <App />,
    errorElement: <Error />,
    children: [
      {
        path: "/Cadastrar",
        element: <Cadastrar />,
      },
      {
        path: "/Visualizar",
        element: <Visualizar />,
      },
      {
        path: "/visualizar/:id/:nome",
        element: <VisualizarDB />,
      },
      {
        path: "/",
        element: <Home />,
      },
    ],
  },
]);

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <RouterProvider router={router}>
      <Route
        path="/cadastrar"
        element={<Redirect to="/Cadastrar" />} // Redirecionamento de "/cadastrar" para "/Cadastrar"
      />
      {/* Outros redirecionamentos aqui, se necess√°rio */}
    </RouterProvider>
  </React.StrictMode>
);
